def action_features(machine, field_prefix):
    res = []
    action_list = ['will', 'wont', 'do', 'dont']
    for action in action_list:
        machine_items = get_field(machine, '{}_{}'.format(field_prefix, action), t='dict')
        machine_names = {item['name']: int(item['value']) for item in machine_items}
        for name in telnet_friendly_names:
            res += [
                Feature(as_obj={
                    '_id': '{}_{}_{}'.format(field_prefix, action, name),
                    '_type': 'MACHINE',
                    'expansion_safe': True,
                    'value': machine_names[name] if name in machine_names else 0,
                    'description': 'The server {} the client to perform the '
                                   '{}, see https://tools.ietf.org/html/rfc854.'.format(action, name)
                })
            ]
    return res


def meta_features(machine, field_prefix):
    res = [
        Feature(as_obj={
            '_id': '{}_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine, '{}_support'.format(field_prefix), t='int'),
            'description': 'is {} supported?'.format(field_prefix)
        })
    ]
    res += common_models(machine, field_prefix, telnet_models)

    success_connects = ['200 ', '220 ', 'ready', 'go ahead', 'OK', 'begin']
    msg = get_field(machine, '{}_banner'.format(field_prefix), t='str')
    connection_successful = any([_s in msg for _s in success_connects])
    res += [
        Feature(as_obj={
            '_id': '{}_CONN_SUCCESS'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': connection_successful,
            'description': 'was the connection '
                           'to this {} server '
                           'successful?'.format(field_prefix)
        })
    ]
    return res


def extract(machine, args):
    res = []
    protocol = 'telnet'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_banner'.format(port, protocol)
        res += meta_features(machine, field_prefix)
        res += action_features(machine, field_prefix)
    return res


